import React, { Component } from 'react'

export default class Header extends Component {
    render() {
        return (
            <div>
                <header style={HeaderStyle}>
                    <h4>welcom to userform</h4>
                </header>
            </div>
        )
    }
}

const HeaderStyle={
    height:"50px",
    display:"flex",
    "justify-content":"center",
    "align-items":"center",
    background:"#333",
    color:"#fff",
    textAlign:"center",
    padding:"10px",
    fontSize:"24px"
}
